import React, { Component } from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import UserRoutes from './routes/UserRoutes'
import GuestRoutes from './routes/GuestRoutes'
import './App.css';

class App extends Component {
  constructor(props) {
    super(props)
    this.state = {
      isLoggedIn: false
    }
  }


  UserRoutes = () => {
    return (
      <Router>
        <div>
          <div className="content">
            <Switch>
              <Route exact path="/" component={UserRoutes} />
              <Route exact path="/account" component={UserRoutes} />
              <Route path="/account/*" component={UserRoutes} />
              <Route path="/profile" component={UserRoutes} />
              <Route path="/profile/*" component={UserRoutes} />
              <Route path="/employee" component={GuestRoutes} />
            </Switch>
          </div>
        </div>
      </Router>
    );
  }

  Employeeroutes = () => {
    return (
      <Router>
        <div className="App">
          <div className="content">
            <Switch>
              <Route path="*" component={GuestRoutes} />
            </Switch>
          </div>
        </div>
      </Router>
    )
  }


  render() {
    switch (this.state.isLoggedIn) {
      case false:
        return this.UserRoutes()
      case true:
        return this.Employeeroutes()
      default:
        return this.UserRoutes()
    }
  }
}


export default App;
